import React, { useEffect, useState } from 'react'

function Patient() {
	const [detail, detailSet] = useState({ patientname: '' })

	let getDetail = () => {
		fetch('/patient')
			.then((response) => response.json())
			.then((data) => detailSet(data))
	}

	useEffect(() => {
		getDetail()
	}, [])

	useEffect(() => {}, [detail])

	return <div>{detail.patientname}</div>
}

export default Patient
